def agent_action(execution_engine, member_id):
    # Check if the member_id is within the bounds of current_members list.
    if member_id >= len(execution_engine.current_members):
        return

    me = execution_engine.current_members[member_id]

    # Loop through all other members to build alliances, provide support, and encourage cooperation.
    for other in execution_engine.current_members:
        # Never target yourself.
        if other.id == me.id:
            continue

        # If the other member is struggling (low vitality) then offer support and invite them to join our coalition.
        if other.vitality < 30.0:
            execution_engine.offer(me, other, True)
            execution_engine.send_message(me.id, other.id,
                "Offering basic income support. Let's join forces to create a robust safety net and cooperative community.")
        else:
            # For members with higher vitality, propose trading systems and long-term alliances.
            execution_engine.send_message(me.id, other.id,
                "Let's establish regular exchanges and mutual support to boost our community's prosperity.")

    # Additionally, if our own vitality is high, we consider sharing some benefit with trusted neighbors.
    # We check our 'current_clear_list' to verify we have valid neighbor IDs.
    for neighbor_id in me.current_clear_list:
        # Validate that neighbor index is in bounds.
        if neighbor_id < len(execution_engine.current_members):
            neighbor = execution_engine.current_members[neighbor_id]
            # If neighbor seems stable but we still want to invest in our coalition, send a friendly message.
            if neighbor.vitality >= 30.0:
                execution_engine.send_message(me.id, neighbor.id,
                    "Let's pursue joint initiatives for resource sharing and democratic decision-making. Together, we thrive.")

    # End of action: focusing on coalition building, resource redistribution and trade for a safer society.

